import { Row,Col, Container } from 'react-bootstrap';
import './App.css';
import Hasil from './components/Hasil';


function App() {
  return (
    <div className="App">
      <NavbarComponent />
      <div className="mt-3">
        <Container fluid>
          <Row>
            <ListCategori />
            <Col>
              <h4><strong>Daftar Produk</strong></h4>
              <hr />
            </Col>
            <Hasil/>
          </Row>
        </Container>
      </div>

    </div>
  );
}

export default App;
